import React from "react";


export const Footer = () =>{
  return(
    <footer class="bg-violet-700 absolute bottom-0 h-1/6 w-full">
      <div class="bock object-center">
        <p>Ⓒ MyIziCourse.com</p>
        <p>Все права защищены</p>
        <p>2024</p>
      </div>
    </footer>
  )
}
